pca.singular_values_ ]\n        # Submit the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{},"id":"1164","type":"CategoricalTicker"},{"attributes":{"tools":[{"id":"1137"},{"id":"1139"},{"id":"1140"},{"id":"1141"},{"id":"1142"},{"id":"1143"}]},"id":"1130","type":"Toolbar"},{"attributes":{"url":"./profile?key=@name"},"id":"1138","type":"OpenURL"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{"callback":{"id":"1138"}},"id":"1139","type":"TapTool"},{"attributes":{"fill_alpha":{"field":"alpha"},"fill_color":{"field":"color"},"height":{"value":0.4},"line_alpha":{"value":0.6},"line_color":{"field":"color"},"line_width":{"value":3},"width":{"field":"duration"},"x":{"field":"start"},"y":{"field":"y"}},"id":"1132","type":"Rect"},{"attributes":{"overlay":{"id":"1459"}},"id":"1140","type":"BoxZoomTool"},{"attributes":{},"id":"1085","type":"BasicTicker"},{"attributes":{"below":[{"id":"1163"}],"center":[{"id":"1165"},{"id":"1168"}],"left":[{"id":"1166"}],"name":"bandwidth_worker_heatmap","renderers":[{"id":"1174"}],"right":[{"id":"1176"}],"sizing_mode":"stretch_both","title":{"id":"1153"},"toolbar":{"id":"1169"},"toolbar_location":null,"x_range":{"id":"1155"},"x_scale":{"id":"1159"},"y_range":{"id":"1157"},"y_scale":{"id":"1161"}},"id":"bk-bandwidth-worker-plot","subtype":"Figure","type":"Plot"},{"attributes":{"axis":{"id":"1084"},"coordinates":null,"group":null,"ticker":null,"visible":false}
